import React from 'react'

const Brand = props => {

    let content = (
        <div className="container content-center mx-auto flex flex-wrap">
            <h2 className="object-none object-center align-middle font-sans font-bold text-gray-900">mormade</h2>
        </div>
    )

    return content
}

export default Brand
